import React, { useState, useEffect } from 'react';
import Navbar from '../../components/Navbar';
import Notification from './../../Notification';
import { useAuth } from '../../../src/AuthContext';
// import './css/EmployeeDashboard.css'; // optional custom CSS

function EmployeeDashboard() {
  const { user: employee } = useAuth();
  const [transactions, setTransactions] = useState([]);
  const [selectedTx, setSelectedTx] = useState(null);
  const [success, setSuccess] = useState('');
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchTransactions = async () => {
      try {
        const response = await fetch(`https://localhost:7150/api/employee/transactions`);
        if (!response.ok) throw new Error('Failed to fetch');
        const data = await response.json();
        setTransactions(data);
      } catch (err) {
        setError('Could not load transactions.');
        console.error(err);
      }
    };

    fetchTransactions();
  }, []);

  const openModal = (tx) => setSelectedTx(tx);
  const closeModal = () => setSelectedTx(null);

  const handleVerify = async () => {
    try {
      const res = await fetch(`https://localhost:7150/api/employee/verify/${selectedTx.id}`, {
        method: 'PUT'
      });

      if (!res.ok) throw new Error('Verification failed');

      // Update UI
      setTransactions(prev =>
        prev.map(tx =>
          tx.id === selectedTx.id ? { ...tx, status: 'Verified' } : tx
        )
      );
      setSuccess(`Transaction #${selectedTx.id} verified successfully`);
      closeModal();
    } catch (err) {
      setError('Verification failed');
    }
  };

  return (
    <>
      <Navbar userType="Employee" />
      <div className="dashboard-container">
        <h2>Employee Dashboard</h2>
        <h3>Welcome, {employee?.fullName}</h3>

        {success && <Notification message={success} type="success" />}
        {error && <Notification message={error} type="error" />}

        <h3>Transactions to Verify</h3>
        <table>
          <thead>
            <tr>
              <th>Amount</th>
              <th>Currency</th>
              <th>Provider</th>
              <th>Status</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {transactions.map(tx => (
              <tr key={tx.id}>
                <td>{tx.amount}</td>
                <td>{tx.currency}</td>
                <td>{tx.provider}</td>
                <td>{tx.status}</td>
                <td>
                  <button
                    onClick={() => openModal(tx)}
                    disabled={tx.status === 'Verified'}
                  >
                    {tx.status === 'Verified' ? 'Already Verified' : 'Verify'}
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>

        {/* Modal */}
        {selectedTx && (
          <div className="modal">
            <div className="modal-content">
              <h3>Verify Transaction #{selectedTx.id}?</h3>
              <p>Amount: {selectedTx.amount}</p>
              <p>Currency: {selectedTx.currency}</p>
              <button onClick={handleVerify}>Confirm</button>
              <button onClick={closeModal}>Cancel</button>
            </div>
          </div>
        )}
      </div>
    </>
  );
}

export default EmployeeDashboard;
